import './mainPage.css';
import NavBar from '../components/navBar/navBar';
import LeftColumn from '../components/leftColumn/leftColumn';
import RightColumn from '../components/rightColumn/rightColumn/rightColumn';
import Footer from '../components/footer/footer';


class MainPage extends Component {
    state = { 
       posts: [
          {title: 'FRENCH CREPE FROM BORDEAUX, FRANCE', image: 'https://images.unsplash.com/photo-1584299574144-b5f8ac209707?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjB8fGZyYW5jZXxlbnwwfDJ8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60' , desc: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duo Reges: constructio interrete. Sine ea igitur iucunde negat posse se vivere? At hoc in eo M. Nihil illinc huc pervenit. Qui autem esse poteris, nisi te amor ipse ceperit? Sumenda potius quam expetenda. Age, inquies, ista' }
       ]
    }
  render() {
    return (
      <div className="body">
        <NavBar />
        <div className="middlePart">
          <LeftColumn />
          <RightColumn />
        </div>
        <Footer />
      </div>
    );
  }
}

export default MainPage;
